import React from 'react'
import { Link,useNavigate } from 'react-router-dom';




const DeleteNote = (props) => {   
    const navigation = useNavigate();
    if(props.passDeleteDetails){
        const handleDelete = () => {
        props.getDeleteKey(props.passDeleteDetails.key);
        navigation('/notes/list');
        }
        return (
            <div>
            <div className="ui content">
            <div align="center"><h2 className="header">Are you sure to delete this contact</h2></div>
            <br/>

            <div style={{display:"flex",flexDirection:"row",flex:"1",justifyContent:"center",alignItems:"center"}}>
            <Link to="/notes/details">
            <button  className="ui button black"> GoBack</button></Link>
            <button className="ui button red" onClick={handleDelete}>Delete </button>
            </div>
            </div>  
        </div>
        );
    }

    else{
        return(
            <div align="center"><h3>No data available to delete</h3></div>
        );
    }
}

export default DeleteNote;
